webpackJsonp([491],{"./node_modules/json-loader/index.js!./.cache/json/articles-meta-free-code-camp-brownie-points.json":function(e,o){e.exports={data:{markdownRemark:{html:'<p>The number beside your picture on Free Code Camp tells you how many Brownie Points you have.</p>\n<p><img src="//discourse-user-assets.s3.amazonaws.com/original/2X/a/aa0c6b56b3b0d4f3acd63212b5e737fdcdd75729.png" alt="A user profile picture next to a with Brownie Points score"></p>\n<p>There are two ways you can get Brownie Points:</p>\n<ol>\n<li>Complete challenges - you get one point per challenge you complete</li>\n<li>Help other campers in chat - each time you help another camper and they thank you (by typing "thanks <span class="mention">@yourname</span>"), you will get a point</li>\n</ol>\n<blockquote>\n<p>Brownie Points help you look like the kind of person who codes a lot, shares relevant links, and helps people.</p>\n</blockquote>\n<p><em>They also add to your <a href="http://forum.freecodecamp.com/t/free-code-camp-streaks/18379">Streak</a>.</em></p>',frontmatter:{title:"Free Code Camp Brownie Points",parent:"/home/stuart/guides/src/pages/articles/meta/free-code-camp-brownie-points/index.md absPath of file"}}},pathContext:{slug:"/articles/meta/free-code-camp-brownie-points/"}}}});
